   "source": [
    "The penguins_size.csv dataset contains information of 3 different species of penguins collected from 3 islands in the Palmer Archipelago, Antarctica. There are 344 observations, and a description of the variables contained in the dataset is as follows:\n",
    "\n",
    "species: penguin species (Chinstrap, Adélie, or Gentoo)\n",
    "\n",
    "culmen_length_mm: culmen length (mm)\n",
    "\n",
    "culmen_depth_mm: culmen depth (mm)\n",
    "\n",
    "flipper_length_mm: flipper length (mm)\n",
    "\n",
    "body_mass_g: body mass (g)\n",
    "\n",
    "island: island name (Dream, Torgersen, or Biscoe) in the Palmer Archipelago (Antarctica)​\n",
    "\n",
    "sex: penguin sex\n",
    "\n",
    "The data were collected and made available by Dr. Kristen Gorman and the Palmer Station, Antarctica LTER, and are part of the PAL-LTER data system. The data are publicly accessible on Kaggle and archived within the United States (US) LTER Network’s Information System Data Portal. \n",
    "\n",
    "The dataset can be found on Kaggle at this link:  https://www.kaggle.com/datasets/parulpandey/palmer-archipelago-antarctica-penguin-data"
   ]
  },
