   "source": [
    "penguin_island <- table(df$species, df$island)\n",
    "\n",
    "col_total <- colSums(penguin_island)  \n",
    "col_tab <- rbind(penguin_island,col_total) \n",
    "\n",
    "row_total <- rowSums(col_tab) \n",
    "\n",
    "penguin_island_freq <- cbind(col_tab, row_total) \n",
    "penguin_island_freq"
   ]
  },
