   },
   "source": [
    "We look at the chi-square statistic and compare to the decision point value of corresponding to a degree of freedom of 4 which is 9.49. Since the test statistic is larger than the DP, we have enough evidence to reject the null hypothesis and conclude that species and islands are significantly independent to each other among all subjects in the population."
