     "start_time": "2023-11-22T19:23:47.325649",
     "status": "completed"
    },
    "tags": []
   },
   "source": [
    "H0:The variables \"gender\" and \"islands\" are independent.\n",
    "\n",
    "H1: The variables \"gender\" and \"islands\" are not independent."
   ]
  },
