   },
   "source": [
    "We look at the chi-square statistic and compare to the decision point value of corresponding to a degree of freedom of 2 which is 5.99. Since the test statistic is less than the DP, we do not have enough evidence to reject the null hypothesis and conclude that gender and island are significantly independent to each other among all subjects in the population."
