   "source": [
    "df$species <- as.factor(df$species)\n",
    "custom_colors <- c(\"lightblue3\", \"salmon2\", \"khaki\")\n",
    "\n",
    "# Plot with custom colors\n",
    "plot(df$body_mass_g, df$flipper_length_mm, xlab = \"Body mass (g)\", ylab = \"Flipper length (mm)\", col = custom_colors[as.numeric(df$species)], pch = as.numeric(df$species))\n",
    "\n",
    "# Adding a legend\n",
    "legend(\"topright\", legend = levels(df$species), col = custom_colors, pch = 1:length(levels(df$species)))\n",
    "\n",
    "# Fit the regresssion line\n",
    "\n",
    "LeastSquares = lm(df$flipper_length_mm ~ df$body_mass_g) \n",
    "\n",
    "abline(LeastSquares)"
   ]
